<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantNameVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantRootVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantDomainVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantEnabledVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantMarkForDeleteVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantMarkForDeleteTimeVO;
use Civi\Lughauth\Features\Access\Tenant\Domain\ValueObject\TenantVersionVO;
use Civi\Lughauth\Features\Access\Tenant\Application\Usecase\Retrieve\TenantRetrieveResult;
use PHPUnit\Framework\TestCase;

final class TenantRetrieveResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TenantRetrieveResult();
        $nameOneValue = 'one';
        $nameOtherValue = 'other';
        $copy = $value->name($nameOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getName());
        $this->assertNotEquals('other', $value->getName());
        $this->assertEquals('one', $value->getNameOrDefault(TenantNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('other', $value->getNameOrDefault(TenantNameVO::from($nameOtherValue))->value());
        $value->unsetName();
        $this->assertEquals('other', $value->getNameOrDefault(TenantNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('one', $value->getNameOrDefault(TenantNameVO::from($nameOtherValue))->value());
        $rootOneValue = true;
        $rootOtherValue = false;
        $copy = $value->root($rootOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getRoot());
        $this->assertNotEquals(false, $value->getRoot());
        $this->assertEquals(true, $value->getRootOrDefault(TenantRootVO::from($rootOtherValue))->value());
        $this->assertNotEquals(false, $value->getRootOrDefault(TenantRootVO::from($rootOtherValue))->value());
        $value->unsetRoot();
        $this->assertEquals(false, $value->getRootOrDefault(TenantRootVO::from($rootOtherValue))->value());
        $this->assertNotEquals(true, $value->getRootOrDefault(TenantRootVO::from($rootOtherValue))->value());
        $domainOneValue = 'one';
        $domainOtherValue = 'other';
        $copy = $value->domain($domainOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getDomain());
        $this->assertNotEquals('other', $value->getDomain());
        $this->assertEquals('one', $value->getDomainOrDefault(TenantDomainVO::from($domainOtherValue))->value());
        $this->assertNotEquals('other', $value->getDomainOrDefault(TenantDomainVO::from($domainOtherValue))->value());
        $value->unsetDomain();
        $this->assertEquals('other', $value->getDomainOrDefault(TenantDomainVO::from($domainOtherValue))->value());
        $this->assertNotEquals('one', $value->getDomainOrDefault(TenantDomainVO::from($domainOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getEnabled());
        $this->assertNotEquals(false, $value->getEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(TenantEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(TenantEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(TenantEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(TenantEnabledVO::from($enabledOtherValue))->value());
        $markForDeleteOneValue = true;
        $markForDeleteOtherValue = false;
        $copy = $value->markForDelete($markForDeleteOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getMarkForDelete());
        $this->assertNotEquals(false, $value->getMarkForDelete());
        $this->assertEquals(true, $value->getMarkForDeleteOrDefault(TenantMarkForDeleteVO::from($markForDeleteOtherValue))->value());
        $this->assertNotEquals(false, $value->getMarkForDeleteOrDefault(TenantMarkForDeleteVO::from($markForDeleteOtherValue))->value());
        $value->unsetMarkForDelete();
        $this->assertEquals(false, $value->getMarkForDeleteOrDefault(TenantMarkForDeleteVO::from($markForDeleteOtherValue))->value());
        $this->assertNotEquals(true, $value->getMarkForDeleteOrDefault(TenantMarkForDeleteVO::from($markForDeleteOtherValue))->value());
        $markForDeleteTimeOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $markForDeleteTimeOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->markForDeleteTime($markForDeleteTimeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getMarkForDeleteTime());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getMarkForDeleteTime());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getMarkForDeleteTimeOrDefault(TenantMarkForDeleteTimeVO::from($markForDeleteTimeOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getMarkForDeleteTimeOrDefault(TenantMarkForDeleteTimeVO::from($markForDeleteTimeOtherValue))->value());
        $value->unsetMarkForDeleteTime();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getMarkForDeleteTimeOrDefault(TenantMarkForDeleteTimeVO::from($markForDeleteTimeOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getMarkForDeleteTimeOrDefault(TenantMarkForDeleteTimeVO::from($markForDeleteTimeOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TenantVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TenantVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TenantVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TenantVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
